//Duration轉換成sec
function DurationTextToSec(InputText , CurFrameRate){
var ItemFrameRate, InputMin, InputSec, InputFrame, TotalSec;

ItemFrameRate = CurFrameRate;

InputMin = eval(InputText.split(";")[0]);
InputSec = eval(InputText.split(";")[1]);
InputFrame = eval(InputText.split(";")[2]);
TotalSec = InputMin*60 + InputSec + InputFrame/ItemFrameRate ;

if(InputFrame >= ItemFrameRate){
    alert("請輸入小於item FrameRate 的 frames~");
    Execute = 0;
    return null;
 }else{
     return TotalSec;
 }
}

