function ChangeOutputPath(IFRemainLocation, RemainedPath ,FileType,CurComp,CurRQItem){
try{
        //設定filePath
    /*
        1.跳出dialog
        2.儲存path的資訊
        3.驗證如果RemainPath有打開則保留path資訊，不然則再次跳出dialog
    */
    var FilePath = new File();
    var FileSuffix = "";
    var ExportToFilePath = "";
    var filetypeindex;

    if(IFRemainLocation == 0){
        FilePath = File.openDialog("Please Select Your Output Path: ");
    }else{
        FilePath = RemainedPath;
    }
    
    if(FilePath == null){
        //default輸出在桌面上
        ExportToFilePath = "~/Desktop" + "/" + myComp.name.toString();
    }else{
        
        //確定不是null了再填入.jpg
        if(FileType == "JPG"){
            filetypeindex = ".jpg";
            FilePath = File(FilePath.toString() + filetypeindex);
        }else if(FileType == "PNG"){
            filetypeindex = ".png";
            FilePath = File(FilePath.toString() + filetypeindex);
        }
    
        //驗證export資料夾是否有重複的version(suffix自動加一)
        var doc = new File(FilePath.toString());
        if(doc.exists == false){
//~             alert("目前file在: " +FilePath.toString() );
            ExportToFilePath = FilePath.toString();
        }else{
            //check第幾version
//~             alert(FilePath.toString() + "已經存在了，現在要增加version!");
            var n = 1;
            var Checkdoc = new File(FilePath.toString().replace(filetypeindex , "_v" + n.toString() + filetypeindex));
//~             alert(Checkdoc.toString());
            if(Checkdoc.exists == false){
//~                 alert("v1!");
                FileSuffix = "_v1";
                ExportToFilePath = FilePath.toString().replace(filetypeindex , FileSuffix + filetypeindex);
            }else{
                while(Checkdoc.exists == true){
//~                     alert("v" + n.toString());
                    n++;
                    Checkdoc = File(FilePath.toString().replace(filetypeindex , "_v" + n.toString() + filetypeindex));
                    }
            FileSuffix = "_v" + n.toString();
            ExportToFilePath = FilePath.toString().replace(filetypeindex , FileSuffix + filetypeindex);
            }
        }
    }
    CurRQItem.outputModule(1).file = File(ExportToFilePath.toString());
    FilePath = File(FilePath.toString().replace(filetypeindex,""));
    return FilePath;
//~     alert("改變的path為: " + CurRQItem.outputModule(1).file.toString());
}catch(err){err.line.toString() + "\r" + err.toString()};
}





