function FindParentPath(FilePath){
    try{    
        var ParentPath = "";
        var FileLocation = FilePath;
        var SlashindexArray = new Array();
        var PathDeleteIndex;
        var ParentLocation = new Array();
        
        for(var i=0; i<FileLocation.length; i++){
            if(FileLocation[i] == "/"){
                SlashindexArray[SlashindexArray.length] = i;
            }
        }
        PathDeleteIndex = SlashindexArray[SlashindexArray.length-1];

        for(var n=0; n<PathDeleteIndex;n++){
            ParentLocation[ParentLocation.length] = FileLocation[n];
        }
        ParentPath = ParentLocation.join(",").toString().replace(new RegExp (",", "g"),"");
        return ParentPath;
    }catch(err){err.line.toString() + "\r" + err.toString()};
}
function FindFileName(FilePath){
    try{
        var FileLocation = FilePath;
        var SlashindexArray = new Array();
        var PathDeleteIndex;
        var FileName = new Array();
        var ReturnName = "";

        for(var i=0; i<FileLocation.length; i++){
            if(FileLocation[i] == "/"){
                SlashindexArray[SlashindexArray.length] = i;
            }
        }
        PathDeleteIndex = SlashindexArray[SlashindexArray.length-1];

        for(var n=PathDeleteIndex+1; n<FileLocation.length;n++){
            FileName[FileName.length] = FileLocation[n];
        }
        ReturnName = FileName.join(",").toString().replace(new RegExp (",", "g"),"");
        return ReturnName;
    }catch(err){err.line.toString() + "\r" + err.toString()};
}
